function summarizeArticle(urls, callback){
    $.post(
        'https://apiv2.indico.io/apis/summarization/batch',
        JSON.stringify({
            'api_key': "952364b8a091bc91909e184032396897",
            'data': urls
        })
    ).then(function(res) { callback(res) });
}

function analyseText(text, callback){
    var sentences = splitSentences(text);
    $.post(
        'https://apiv2.indico.io/apis/multiapi/batch?apis=sentimenthq,texttags,keywords,people,places,organizations,personality,emotion',
        JSON.stringify({
            'api_key': "952364b8a091bc91909e184032396897",
            'data': sentences
        })
    ).then(function(res) { callback(res) });
}

function splitSentences(text){
    var sentences = text.split(".");
    for (i = 0; i<sentences.length; ++i){
        sentences[i] = sentences[i].trim()+".";
    }
    return sentences.slice(0, sentences.length-1);
}

